import React from "react";

function Covid19For(){
    return (
        <>
        <div style={{width:'30%', margin:'5px'}}>
            <div style={{alignItems:'center'}}>
                <span>Total</span><span style={{fontWeight:'bold', fontSize:'40px'}}>Recovery</span>
            </div>
        </div>
        </>
    )
}

export default Covid19For;
